import React from 'react';

import 'bootstrap/dist/css/bootstrap.min.css';

function tableHeader() {
    const id = "ID:"
    const name = "NAME:"
    const department = "DEPARTMENT:"
    const role = "ROLE:"
    const email = "E-MAIL:"



    return (
    <h3>{id}</h3>,
    <h3>{name}</h3>,
    <h3>{department}</h3>,
    <h3>{role}</h3>,
    <h3>{email}</h3>
    );
  }
export default tableHeader;
